import React from 'react';

//DO NOT DELETE CSS FILES AND SCRIPTS ARE ATTATCH!!!========
import Header from "../../components/admin/partials/Header";
import Footer from "../../components/admin/partials/Footer";
//==========================================================
import "../../assets/css/myCss.css";
export default function AdminLayout(props) {
    return (
        <>
            <div className="my-side-bar">
                <div className="my-brand">
                    <i data-toggle="tooltip" title="Home" data-placement="top" class="fas fa-notes-medical"></i>
                </div>
                <div>
                    <i title="Medication(s)" class="fas fa-capsules"></i>
                </div>
                <div>
                    <i title="Group(s)" class="fas fa-users"></i>
                </div>
                <div>
                    <i title="User(s)" class="fas fa-user-shield"></i>
                </div>
                <div>
                    <i title="My Profile" class="fas fa-user-md"></i>
                </div>
            </div>
            <div className="my-top-nav">
                top
            </div>
            <div className="main">
                <div style={{heigth:'1000px'}}>
                    {this.props.children}
                </div>
            </div>
            
        </>
    );
}
